import React from 'react'
import Avatar from '@material-ui/core/Avatar';
import "antd/dist/antd.css";
import { Menu } from "antd";
import {Link} from "react-router-dom"
import {FetchDoPost,FetchDoGet} from './../commons/Utils'

import {
    MailOutlined,
    AppstoreOutlined,
    SettingOutlined
  } from "@ant-design/icons";

import './../commons/commons.css'


const { SubMenu } = Menu;

/**
 * 我们顶部的基本操作
 */
class HeaderPrivate extends React.Component{
    constructor(props){
        super(props)
        this.state={
            open:false
        }
    }

    handleClick = e => {
        console.log("click ", e);
        this.setState({
          current: e.key
        });
    };

    clickExit=e=>{
        console.log(e)
        FetchDoPost("/block/v1/sys_user/exit",function(response){
            console.log("exit",response)
            window.location.href="/"
        })
    }


    render(){
        let {avatar,name}=this.props;

        console.log("name",name)

        let {open} =this.state;

        return(
            <div className="header-class">
                <div className="header-title">基于区块链的光网络建设管理平台</div>
                <div className="header-avater-private">
                    <Menu
                        onClick={this.handleClick}
                        selectedKeys={[this.state.current]}
                        mode="horizontal"
                        >
                            <SubMenu
                            title={
                                <span className="submenu-title-wrapper">
                                {/* <SettingOutlined /> */}
                                <Avatar variant="circle" alt={name}
                                    style={{
                                        color: '#f56a00',
                                        backgroundColor: '#fde3cf',
                                    }}
                                    >
                                    {name}
                                </Avatar>
                                </span>
                            }
                            >
                            {/* <Menu.ItemGroup title="Item 1">
                                <Menu.Item key="setting:1">Option 1</Menu.Item>
                                <Menu.Item key="setting:2">Option 2</Menu.Item>
                            </Menu.ItemGroup> */}
                           <Menu.Item key="setting:3">
                               <Link to="/userinfo">
                                个人信息
                               </Link>
                            </Menu.Item>
                            <Menu.Item key="setting:4" onClick={this.clickExit}>退出</Menu.Item>
                            </SubMenu>
                    </Menu>


                </div>
            </div>
        )
    }
}

export default HeaderPrivate
